int matrixChainMultiply(vector<Matrix> &matrixs) {
    int n = matrixs.size();
    // åˆå§‹åŒ–çŸ©é˜µé“¾ä¹˜æ³•ç»“æœçŸ©é˜µ
    int dp[n][n];
    for (int i = 0; i < n; i++) {
        for (int j = 0; j < n; j++) {
            dp[i][j] = 0;
        }
    }
    // è®¡ç®—çŸ©é˜µé“¾ä¹˜æ³•ç»“æœ
    for (int len = 2; len <= n; len++) {
        for (int i = 0; i <= n - len; i++) {
            int j = i + len - 1;
            dp[i][j] = INT_MAX;
            for (int k = i; k < j; k++) {
                int temp = dp[i][k] + dp[k + 1][j] + matrixs[i].row * matrixs[k].col * matrixs[j].col;
                if (temp < dp[i][j]) {
                    dp[i][j] = temp;
                }
            }
        }
    }
    return dp[0][n - 1];
}

